
$(document).ready(function(){$("#id_prov").change(function(){var id_prov={id_prov:$("#id_prov").val()};$.ajax({type:"POST",url:url+'getKab',data:id_prov,success:function(dt){$('#id_kab').html(dt);$("#kabupaten").show();}});});$("#id_kab").change(function(){var id_kab={id_kab:$("#id_kab").val()};$.ajax({type:"POST",url:url+'getKec',data:id_kab,success:function(dt){$('#id_kec').html(dt);$("#kecamatan").show();}});});$("#id_kec").change(function(){var id_kec={id_kec:$("#id_kec").val()};$.ajax({type:"POST",url:url+'getKel',data:id_kec,success:function(dt){$('#id_kel').html(dt);$("#kelurahan").show();}});});})
